In the week ending December 11, 2020, there were 335 patients hospitalized with confirmed or suspected cases of Covid-19 in Westchester hospitals (21% of all inpatients). 74% of all inpatient beds were occupied and 59% of all ICU beds were occupied. There were 552 total beds free and 101 ICU beds free.



